$(document).ready(function(){$("ul.actionMenu").menu();$("ul.actionMenu").menu({select:function(a,d){var c=$("a",d.item).attr("data-resvid");if($("a",d.item).attr("data-delete-request")){var b=confirm("Are you sure, you want to delete Request# "+c+" ?");if(b){$("a",d.item).attr("href");return}a.preventDefault();return}}})});$("#tbody").on("mouseleave","ul.actionMenu",function(a){$(this).menu("collapseAll",a,true)});$("#btnGo").button({icons:{secondary:"ui-icon-search"}}).click(function(a){var c=/^\d+$/;var b=$("#frmSearch input:text").val();if(b==""||!c.test(b)){$("#divError").html("Please enter the valid Request ID").removeClass("validation-summary-valid").addClass("validation-summary-errors");return false}});